<?php $__env->startSection('content'); ?><p>Elizabeth Sobinoff has added to her ever-growing tattoo collection.</p>

<p>On Saturday, the former Married At First Sight star showed off her latest ink to fans on Instagram.</p>

<p>Sharing a photo at a Sydney tattoo parlour, Elizabeth, 28, revealed she has added a large design to her inked physique.</p>

<p>She's running out of space! Married At First Sight star Elizabeth Sobinoff, 28, (pictured) has showed off her latest new inking on Saturday</p>

<p>The brunette beauty proudly showed off her new tattoo, which was placed on her left thigh.</p>

<p>The design, which was placed alongside two previously-inked wolves, included a forest, mountain and moon inside a circle. </p>

<p>'Inked up again! Thank you Gillian for my new contribution to my collage,' she wrote.</p>

<p>'If you didn't know me you'd think I was cleaned skin,' she added.</p>

<p>New ink: The brunette beauty proudly showed off her new design which was a black and white circle which shows a forest and mountain design alongside two wolves</p>

<p>Her boyfriend Seb Guilhaus commented underneath her post, writing: 'Insert wolf howl.'</p>

<p>This comes months after the reality TV star revealed a huge new inking underneath her bust, as well as one on her back. </p>

<p>Pulling up her black top, the brunette proudly showed off a bee and flower design across her torso, followed by a kookaburra on one side of her back. </p>

<p>Tatt's hot! A few months earlier, she got a comprehensive new inking, spanning from her back, down the side of her body, and to her thigh</p>

<p>In June 2019, she also got a comprehensive new inking, spanning from her back, down the side of her body, and to her thigh.</p>

<p>The sprawling design incorporating various animals was inspired by the children's book Possum Magic, by author Mem Fox, and the TV show The Animals of Farthing Wood.   </p>

<p>Since meeting on Married At First Sight last year, Elizabeth and her boyfriend Seb recently relocated to Sydney where they are living as a couple.</p>

